        communications:
          - date: 2014-06-06T06:15:23.559Z
            contents:
              en:
                type: doc
                content:
                  - type: paragraph
                    content:
                      - type: text
                        text: 'The '
                      - type: text
                        marks:
                          - type: em
                        text: 'Authority for Consumers and Markets (ACM), '
                      - type: text
                        text: The Hague
                      - type: text
                        marks:
                          - type: em
                        text: ', '
                      - type: text
                        text: >-
                          announces the updated ITU-T E.164 National Numbering
                          Plan for Netherlands.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          1. Unless explicitly determined otherwise in the
                          destination associated with a number, a number
                          included in this numbering plan shall not be used to
                          provide paid services other than electronic
                          communications services if the payment of those
                          services is included in the invoice prepared by the
                          provider of the electronic communications service.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          2. The length of a geographic number is ten digits and
                          the length of a non-geographic number can vary.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          3. A geographic number in which the subscriber number
                          begins with the digits 0,1 or 9 is not available for
                          assignment or reservation .
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          4. A number from the 014 range is available without
                          assignment or reservation, contrary to that stated at
                          the top of the table 1.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          5. A geographic or non-geographic number may not
                          consist of another, shorter or longer, geographic or
                          non-geographic number followed by one or more digits.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          6. Since June 1st the +31 970 XXXX XXXX is obligatory
                          for operators for applications that are mobile
                          data-only and do not have a mobile telephony function
                          for voice calling.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          7. The former Numbering Plan for Telephone and ISDN
                          Services (Government Gazette 1996, 144) shall be
                          revoked.
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: strong
                        text: >-
