                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) The service provides the citizen with
                                      information or assistance or a reporting
                                      tool, or a combination thereof.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      b) The service is accessible for all
                                      citizens without any prior registration
                                      requirements.
                                  - type: hard_break
                                  - type: text
                                    text: c) The service is not limited in time.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      d) To be able to make use of the service,
                                      no advance payment or commitment to
                                      payment is required.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      e) During a call there shall be no
                                      advertisements, amusement, marketing or
                                      sales. Similarly, the call shall not be
                                      used for the purposes of selling
                                      commercial services in the future.
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: '116000'
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) The service receives notifications by
                                      telephone of missing children and passes
                                      them on to the police.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      b) The service gives advice/assistance and
                                      supports the parents/guardians of the
                                      missing child.
                                  - type: hard_break
                                  - type: text
                                    text: c) The service supports investigations.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      d) The service is continually available
                                      (24 hours per day, 7 days a week, across
                                      the whole country)
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: '116006'
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) The service enables victims of crime to
                                      get emotional support in such
                                      circumstances, to be informed about their
                                      rights and about ways to claim their
                                      rights, and to be referred to the relevant
                                      organisations.
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      b) In particular, it provides information
                                      about local police and criminal justice
                                      proceedings, and the possibilities of
                                      compensation and insurance matters.
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      c) It also provides support in finding
                                      other sources of help relevant to the
                                      victims of crime.
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      d) Where the service is not continuously
                                      available (i.e. 24 hours a day, 7 days a
                                      week, nation-wide), the service provider
                                      must ensure that information about
                                      availability is made publicly available in
                                      an easily accessible form, and that,
                                      during periods of unavailability, callers
                                      to the service are advised when the
                                      service will next become available.
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: '116111'
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) The service helps children in need of
                                      care and protection and refers them to the
                                      appropriate services and facilities.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      b) The service offers children the
                                      opportunity to express their concerns, and
                                      to talk about matters which directly
                                      concern them, and to contact someone when
                                      an emergency occurs
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      c) If the service is not continuously
                                      available (24 hours per day, 7 days per
                                      week, across the whole country), the
                                      service provider must ensure that the
                                      information about accessibility is
                                      available in a manner that is easily
                                      accessible to the public, and that during
                                      periods when the service is not available,
                                      callers are informed of when the service
                                      will again be accessible.
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: '116117'
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) The service directs callers to the
                                      medical assistance appropriate to their
                                      needs, which are urgent but
                                      non-life-threatening, especially, but not
                                      exclusively, outside normal office hours,
                                      over the weekend and on public holidays.
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      b) It connects the caller to a skilled and
                                      supported call-handler, or connects the
                                      caller directly to a qualified medical
                                      practitioner or clinician.
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      c) Where the service is not continuously
                                      available (i.e. 24 hours a day, 7 days a
                                      week, nation-wide), the service provider
                                      must ensure that information about
                                      availability is made publicly available in
                                      an easily accessible form, and that,
                                      during periods of unavailability, callers
                                      to the service are advised when the
                                      service will next become available.
