                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: >-
                                      a) This service enables the caller to make
                                      direct human contact whereby they are
                                      listened to objectively.
                                  - type: hard_break
                                  - type: text
                                    text: >-
                                      b) The service offers emotional support to
                                      callers who are lonely, undergoing a
                                      psychological crisis or considering
                                      suicide.
